export default class AddUser extends Component {
    constructor(){
        super()
        this.state ={
            clicked_on_view_password :false
        }
    }
    render() {
        return (
            <div style=
            {{
                margin:"1rem",
                display:'flex',
                flexDirection:"column"

            }}>

                <div style={{
                    textAlign:'center',
                    flex:1
                }}>
                    <p>
                        Add User
                    </p>

                </div>
                <div style={{
                    flex:1,
                    backgroundColor:"red",
                    display:'flex',
                    flexDirection:'column'
                }}>
                    <form autoComplete="off">
                        <div style={{
                            flex:1,
                            margin:"1rem"

                        }}>
                            <input placeholder="Name" style={{
                                width:"80%"
                            }}/>
                        </div>
                        <div style={{
                            flex:1,
                            margin:"1rem"
                        }}>
                            <input placeholder="Email"style={{
                                width:"80%"
                            }}/>
                        </div>
                        <div sty>
                            <input type={this.state.clicked_on_view_password?"text":"password"} placeholder="Password"style={{
                                width:"80%"
                            }}/>
                        </div>
                        <div>
                            <input placeholder="confirm password"style={{
                                width:"80%"
                            }}/>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
}
